        {name: 'Friend #2',key:'2'},
        {name: 'Friend #3',key:'3'},
        {name: 'Friend #4',key:'4'},
        {name: 'Friend #5',key:'5'},
        {name: 'Friend #6',key:'6'},
        {name: 'Friend #7',key:'7'},
        {name: 'Friend #8',key:'8'}


    ];

    return (
        // <View>
        // <Text>List Screen</Text>
        //</View>
        <FlatList 
            data = {friends}
            renderItem ={({item}) => {
                return <Text>{item.name}</Text>;
            }}
        />

    );
};

const Styles=StyleSheet.create({});

export default ListScreen;
